import React, { Component } from 'react';
import {connect} from 'react-redux';
import {Route} from "react-router-dom";
// import StrAddButton from '../StrAddButton';
import Problem from './R089_reactRouter';
import Problem2 from './R089_reactRouter2';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';


class App extends Component {
  render() {
    return (
      <div>
        <h1>react 시작</h1>
        <p>html 적용</p>
        {/* <span>{this.props.store.getState().data.str}</span><br/>
        <StrAddButton store={this.props.store}/> */}

        {/* <span>{this.props.str}</span><br/>
        <StrAddButton AppProp="200"/> */}

        <div className="App">
          <Route exact path="/" component={Problem} />
          <Route exact path="/Problem2" component={Problem2} />
        </div>
      </div>
    );
  }
}

let mapStateToProps = (state, props) => {
  console.log("props from index.js : "+props.indexProp)
  return {
    str : state.data.str,
  }
}

App = connect(mapStateToProps, null)(App);

export default App;
